import React, { Component } from 'react';
import './Regular.css';



export default class StyleOptions extends React.Component {
	render() {
	    return (
	    	<form>
	    		<select id="buttons">
		    		<option className="button" onClick={() => this.props.SetColor('white', 'black')}>Professional Mode</option>
		    		<option className="button"  value="green" onClick={() => this.props.SetColor('green', 'green')}>Frog Mode</option>
		    		<option className="button" onClick={() => this.props.SetColor('#FFD7F8', '#DCE5FF')}>Pantone 2017 Mode</option>
		    	</select>
		    	<input type="submit" />
	    	</form>
	    )
}
}
